var certificateModule = (function () {
	return {
		generateCertificate: function (data) {
			var imageData = `data:image/jpeg;base64,`;

			//create  document
			var doc = new jsPDF();

			//add image
			doc.addImage(imageData, 'JPEG', 15, 40, 180, 140);

			//add title

			doc.setFont('times');
			doc.setFontType('italic');
			doc.setTextColor(29, 210, 242);
			doc.setFontSize(28);
			doc.text(105, 65, 'TYPING SPEED CERTIFICATE', 'center');

			//add text
			doc.setTextColor(0, 0, 0);
			doc.setFontSize(18);
			doc.text(105, 78, 'This Certificate is Hereby Awarded to:', 'center');

			//add name
			doc.setTextColor(29, 210, 242);
			doc.setFontSize(24);
			doc.text(105, 88, data.name, 'center');

			//add text
			doc.setTextColor(0, 0, 0);
			doc.setFontSize(18);
			doc.text(
				105,
				100,
				'For Achieving Results noted below as documented',
				'center'
			);
			doc.text(105, 110, 'and verified by 09InfoTech', 'center');

			//add results
			doc.text(105, 124, 'Level:' + data.level, 'center');
			doc.text(105, 132, 'Average Speed:' + data.wpm, 'center');
			doc.text(105, 140, 'Accuracy:' + data.accuracy + '%', 'center');

			//add date
			var date = new Date();
			let day = date.getDate();
			let month = date.getMonth() + 1;
			let year = date.getFullYear();

			// This arrangement can be altered based on how we want the date's format to appear.
			//let currentDate = `${day}/${month}/${year}`;

			// or just use date.toLocaleDateString('en-US')
			doc.text(
				150,
				155,
				'Awarded on: ' + date.toLocaleDateString('en-US'),
				'center'
			);
			//add brand
			doc.text(150, 165, '09InfoTech', 'center');

			//save document
			doc.save('certificate.pdf');
		},
	};
})();
